  wikcionario com a seguinte descri\u00e7\u00e3o - belicoso wikcionario\\nAVAN\u00c7AR
  >>vai ter bbb 2015 inscrever para o bbb 2015 inscri\u00e7\u00f5es para o big brother
  brasil 2015 significado de big brother brasil\"", "\"6 de agosto de 2009\\n> Perfil
  de um amigo\\n\\\"Amigo \u00e9 coisa para se guardar do lado esquerdo do peito\\\"\\nSe
  h\u00e1 quem pense que a amizade sincera \u00e9 um sentimento que n\u00e3o existe
  ou apenas passageira, e precisa ser procurado como um gr\u00e3o de areia, est\u00e1
  certo, amigo de verdade \u00e9 muito raro, e quando se encontra \u00e9 preciso cultivar,
  como uma delicada plantinha, todos os dias.\\nNo decorrer da minha vida, muitas
  vezes me surpreendi acolhendo pessoas, acreditando em amizade sincera, por\u00e9m,
  o tempo se encarregava de mostrar que a amiga(o) era \\\"condicional\\\", e afastava
  os rumos e caminhos, aquela(e) nem sempre se mostrava um verdadeiro amigo.\\nMinha
  fam\u00edlia sempre foi muito pequena, pais, e uma irm\u00e3, que depois de casada
  ficou distante e ausente, cada um tomou seu rumo ap\u00f3s a morte precoce de minha
  querida m\u00e3e, a quem eu amo de paix\u00e3o. Era linda e feliz.\\nDepois de muitos
  trope\u00e7os naturais na vida, os quais n\u00e3o descrevo porque n\u00e3o \u00e9
  o objetivo no momento, encontrava-me s\u00f3zinha no meio da multid\u00e3o, muitos
  \\\"amigos da on\u00e7a enfim completamente s\u00f3.\\nMas, como nesse mundo de
  Deus\\\" nada acontece por acaso\\\", e numa dessas voltas que ele d\u00e1 deparei-me
  de repente com uma pessoa que conheci num evento de meu trabalho no servi\u00e7o
  p\u00fablico de Sa\u00fade em minha cidade.\\nA primeira vista, n\u00e3o notei nenhuma
  diferen\u00e7a entre as outras pessoas envolvidas no mesmo trabalho, mas com o passar
  dos dias, percebi que por mais complicado e dif\u00edcil se tornava o cumprimento
  das obriga\u00e7\u00f5es , havia uma pessoa, que sempre estava sorrindo e bem humorado,
  demonstrando prazer em fazer o trabalho que lhe deram.\\nTodos os dias, pontualmente
  as 6:30 da manh\u00e3, l\u00e1 estava ele, pronto e disposto a cumprir com o nosso
  objetivo dif\u00edcil e sacrificado para mim, era tranquilo e prazeroso a ele.\\nPensava
  comigo: \\\" que pessoa interessante, conversa t\u00e3o bem, \u00e9 inteligente,
  e nada sei sobre ele\\\"; certamente muitas outras vezes devo ter encontrado com
  ele em outros trabalhos, mas n\u00e3o havia notado e nem me chamado aten\u00e7\u00e3o,
  por ser uma pessoa extremamente discreta.\\nResolvi ent\u00e3o, que deveria procurar
  conhecer melhor essa pessoa t\u00e3o simp\u00e1tica e que me chamava tanto a aten\u00e7\u00e3o,
  e comecei por convid\u00e1-lo a tomar um lanche em minha casa, e para minha surpresa,
  ele aceitou. Gra\u00e7as a Deus.\\nEle \u00e9 sem d\u00favida a melhor pessoa que
  conheci na minha vida, capaz de ser sincero sem disfar\u00e7ar, mentir, ou tentar
  tapar o sol com a peneira. Isso eu descobri e tive certeza depois de lhe fazer uma
  pergunta indiscreta e pessoal, e ele teve a honradez de me responder com toda sinceridade
  que jamais eu esperaria, uma vez que eu sabia qual deveria ser a resposta correta.\\nA
  partir desse momento, eu descobri o meu melhor amigo de verdade, aquele que tem
  a coragem de me dizer que errei, porque, quando, e ainda me mostra os meus defeitos
  tortuosos e insuport\u00e1veis, mas n\u00e3o se afasta de mim, mesmo magoado, pagando
  pelo que n\u00e3o fez, atrav\u00e9s de minha irritabilidade, impaciencia, estresse,
  que a vida e o tempo pregou na minha vida, me transformando nessa pessoa torta de
  humor que eu sou.\\nTenho que reconhecer que esse \u00e9 meu amigo , porque mesmo
  sofrendo calado fica ao meu lado, aceita meu pedidos de desculpas, me oferece o
  ombro para chorar as minhas tristezas e inseguran\u00e7as.\\nEle \u00e9 uma pessoa
  maravilhosa, desprovido de interesses materiais, e sempre disposto a entender essa
  minha vida complicada pelo tempo.\\nResolvi hoje que deveria escrever essas coisas,
  que ele j\u00e1 sabe, mas gostaria que as pessoas soubessem tamb\u00e9m, pois, nos
  \u00faltimos meses tenho vivido com a seguran\u00e7a de ter algu\u00e9m para dividir,
  somar quando \u00e9 poss\u00edvel, e aproveitar esse restinho de vida, para desfrutar
  de alguns momentos de traquilidade.\\nPor quest\u00f5es \u00e9ticas, n\u00e3o vou
  aqui mencionar o nome dessa criatura que mudou a minha vida, mas ele sabe que escrevo
  sobre ele. Merece todo meu respeito e considera\u00e7\u00e3o.\\nPara voce meu amigo,
  aquele abra\u00e7o fraterno e amoroso de sempre, e para eternidade.\\nCreio que
  por quest\u00f5es de reconhecimento e justi\u00e7a devo dizer sim que meu amigo
  do cora\u00e7\u00e3o \u00e9 o J. Ara\u00fajo, que muito de voc\u00eas conhecem\"",
  "\"Voc\u00ea j\u00e1 ouviu falar sobre MVP? Esse conceito \u00e9 extremamente importante
  para quem est\u00e1 pensando em come\u00e7ar um neg\u00f3cio ou at\u00e9 mesmo para
  empresas bem consolidadas, mas que querem lan\u00e7ar um novo produto ou mudar processos.\\nNem
  sempre acertamos de primeira, por mais estudos pr\u00e9vios que realizemos. Por
  isso, \u00e9 muito importante fazer uma esp\u00e9cie de teste antes de apostar totalmente
  em uma estrat\u00e9gia.\\nAvaliar o que funciona e o que n\u00e3o funciona \u00e9
  primordial para ter bons resultados e isso est\u00e1 totalmente conectado com o
  MVP. Neste artigo voc\u00ea vai entender um pouco mais sobre esse conceito.\\nO
  que \u00e9 MVP\\nObviamente, a primeira coisa que devemos esclarecer \u00e9 a respeito
  do MVP. O que seria? \u00c9 a sigla para Minimum Viable Product, cuja tradu\u00e7\u00e3o
  \u00e9 M\u00ednimo Produto Vi\u00e1vel.\\n\u00c9 uma estrat\u00e9gia que visa testar
  v\u00e1rias ideias para o seu neg\u00f3cio, avaliando aquilo que pode ou n\u00e3o
  funcionar. Existem diferentes MVPs, mas o princ\u00edpio de todos eles \u00e9 o
  mesmo.\\nO conceito foi desenvolvido por Eric Ries, que traz o MVP como uma maneira
  de evitar gastos precipitados.\\nO MVP tem por objetivo testar a aceita\u00e7\u00e3o
  de um servi\u00e7o ou produto no mercado antes de ele ser definitivamente lan\u00e7ado.\\nApesar
  de ser algo muito relacionado com startups, o conceito de M\u00ednimo Produto Vi\u00e1vel
  vem sendo utilizado por diversas empresas, at\u00e9 mesmo as mais consolidadas no
  mercado.\\nFinalidades de um MVP\\nOs objetivos de um MVP s\u00e3o diversos, sendo
  que a finalidade ir\u00e1 depender muito do seu tipo de neg\u00f3cio. De modo geral,
  essa t\u00e9cnica pode ser utilizada para:\\nValidar um modelo\\nEssa t\u00e9cnica
  pode ser utilizada para validar um modelo de neg\u00f3cios, ou seja, avaliar se
  determinado produto ou servi\u00e7o, sendo oferecido de determinada maneira, realmente
  tem potencial para crescer no mercado.\\nAvaliar melhor o mercado\\nNa teoria tudo
  \u00e9 lindo! Por\u00e9m, quando passamos para a pr\u00e1tica fica f\u00e1cil ver
  que nem tudo \u00e9 como esper\u00e1vamos. Ao partir para um MVP voc\u00ea consegue
  ter uma pr\u00e9via do que seria a sua pr\u00e1tica e, ent\u00e3o, passa a conhecer
  um pouco melhor o mercado.\\nObter investimentos\\nN\u00e3o \u00e9 incomum que investidores
  apostem em MVPs. Se a ideia realmente parecer promissora aos olhos dos investidores,
  eles podem, sim, contribuir financeiramente para que o projeto decole.\\nComo elaborar\\nPara
  que o MVP seja, de fato, fact\u00edvel, voc\u00ea precisa responder algumas perguntas,
  como:\\n- Para que ir\u00e1 servir\\n- Quem \u00e9 o p\u00fablico-alvo?\\n- Quais
  os custos de produ\u00e7\u00e3o ou opera\u00e7\u00e3o?\\n- Qual ser\u00e1 a solu\u00e7\u00e3o
  proposta ao p\u00fablico?\\n- Como chegar a essa solu\u00e7\u00e3o?\\n- O que tem
  de inovador?\\n- Qual o tamanho do mercado?\\nA partir disso voc\u00ea consegue
  avaliar melhor qual ser\u00e1 o seu direcionamento nesse novo projeto.\\nSaiba a
  hora de desistir\\n\u00c9 claro que desejamos que o seu projeto deslanche e que
  voc\u00ea atinja os melhores resultados do mercado, por\u00e9m, \u00e9 muito importante
  que voc\u00ea saiba a hora de desistir de um MVP.\\nEste m\u00e9todo \u00e9 utilizado
  justamente para avaliar a viabilidade de um produto ou servi\u00e7o no mercado.\\n\u00c9
  claro que voc\u00ea pode ir ajustando o seu MVP, por\u00e9m \u00e9 importante avaliar
  os resultados e as tentativas\u2026 chega um momento que voc\u00ea precisa se desapegar,
  pois esse projeto pode n\u00e3o ter sido a melhor escolha.\\nIsso quer dizer que
  voc\u00ea n\u00e3o vai trazer algo novo para o seu neg\u00f3cio? De forma alguma!
  Por\u00e9m, mudar de direcionamento pode ser a melhor escolha depois de muitas tentativas
  sem retorno.\\nO conceito de MVP pode ser aplicado a muitas coisas e \u00e9 realmente
  fundamental para voc\u00ea conseguir investir de forma muito mais assertiva. Tem
  um projeto em mente? Lide com ele com essa t\u00e9cnica!\"", "\"Amigos,\\nFoi com
  alguma tristeza e da mesma maneira o fa\u00e7o que \u00e9 comunicar ao nosso grupo
  e amigos que nos vistam diariamente que a D\u00aa Angel\u00e2 ( Esposa do Z\u00e9
  Menor ) n\u00e3o conseguiu superar o seu mau estado de saude e acabou por falecer,
  deixando-nos de uma maneira ingrata e injusta, mas felizmente e devido ao tempo
  que passei na sua companhia, ficarei com uma recorda\u00e7\u00e3o eterna de uma
  pessoa extremamente carinhosa e amiga dos seu amigo, desejando que seja recebida
  para o local onde ir\u00e1 com o devido valor do que acabou por fazer c\u00e1, pois
  saudades vai deixar com toda a certeza. Em rela\u00e7\u00e3o ao meu amigo Z\u00e9
  Menor desejo-lhe muita for\u00e7a e sabe que pode sempre contar comigo para o que
  necessitar, sabendo que n\u00e3o existem palavras para expressar o mau momento que
  neste momento atravessa mas com for\u00e7a e a amizade que o rodeia vai conseguir
  seguir a sua vida para a frente, pois com toda a certeza esse seria um dos desejos
  da sua esposa.\\nATE UM DIA D\u00aa ANG\u00caLA, COM TODA A CERTEZA VOLTAREMOS A
  NOS ENCONTRAR.\"", "\"Nesta sexta feira, (15/09) a Pra\u00e7a da B\u00edblia em
  Bacabal foi palco de mais uma edi\u00e7\u00e3o da Feira do Agricultor Bacabalense.
  Promovida pela Prefeitura de Bacabal, atrav\u00e9s da Secretaria de Agricultura,
  esta iniciativa reuniu os pequenos agricultores e ofereceu todo o suporte necess\u00e1rio
  para a comercializa\u00e7\u00e3o de produtos cultivados nas comunidades rurais locais.\\nO
  resgate da Feira do Agricultor Bacabalense destacou-se como uma das a\u00e7\u00f5es
  priorit\u00e1rias na gest\u00e3o do prefeito Edvan Brand\u00e3o. Ao lado da vice-prefeita
  Graciete Trabulsi, do advogado Dr. Em\u00edlio, do secret\u00e1rio de Agricultura
  Inaldo Nascimento e de vereadores, o prefeito marcou presen\u00e7a no evento, demonstrando
  o comprometimento da administra\u00e7\u00e3o municipal com a valoriza\u00e7\u00e3o
  dos agricultores locais.\\nA Feira do Agricultor Bacabalense \u00e9 um evento tradicional
  promovido pela Prefeitura de Bacabal com o objetivo de apoiar os pequenos agricultores
  e promover a comercializa\u00e7\u00e3o de produtos frescos cultivados nas comunidades
  rurais da regi\u00e3o. A feira tamb\u00e9m busca criar um ambiente prop\u00edcio
  para a intera\u00e7\u00e3o entre agricultores e a comunidade, fortalecendo os v\u00ednculos
  locais.\"", "\"\u201cA cole\u00e7\u00e3o foi inspirada nos estojos de l\u00e1pis
  que eu tinha na escola e nos pirulitos. No entanto a gente n\u00e3o queria que a
  cole\u00e7\u00e3o fosse demasiado elaborada \u2013 n\u00f3s quer\u00edamos algo
  que fosse \u201cwearable\u201d, roupas sofisticadas\u201d, contou Christopher. A
  cole\u00e7\u00e3o intitulada \u201cThe liquid colection\u201c, usou o conceito do
  \u201cl\u00edquido\u201d no acabamento das pe\u00e7as com efeito pl\u00e1stico,
  mesclou os squares de croch\u00ea tom sur tom com couro, inclusive estampou o couro
  com croch\u00ea, acrescentou paet\u00eas e transpar\u00eancias; o que resultou em
  uma cole\u00e7\u00e3o futurista onde o comprimento era nos joelhos, com um toque
  de anos 20 e lind\u00edssima!!\\nPosts relacionados:\"", "\"Igor Grazianno/UFC\\nLuma
  Andrade, na defesa do estudo de doutorado,na Univ. Federal do Cear\u00e1\\nA professora
  Luma Andrade, 35 anos, que se tornou a primeira travesti com doutorado do Brasil
  na sexta-feira (17.08), diz que sua carreira acad\u00eamica vai servir de exemplo
  para que outros travestis busquem na educa\u00e7\u00e3o uma forma de vencer o preconceito.
  \\\"N\u00f3s vivemos numa posi\u00e7\u00e3o que a sociedade nos imp\u00f5e, \u00e0
  margem de tudo. E temos que quebrar esse paradigma e viver no centro da sociedade,
  a educa\u00e7\u00e3o \u00e9 uma das formas que temos para conseguir\\\", diz a professora.\\nLuma
  defendeu o estudo elaborado em tr\u00eas cidades do Cear\u00e1 \\\"Travestis na
  Escola: Asujeitamento e Resist\u00eancia \u00e0 Ordem Normativa\\\", na sexta-feira,
