  essa demanda e prestar um servi\u00e7o diferenciado, a solu\u00e7\u00e3o foi revelar
  fotos tiradas digitalmente, e existe um site em especial que faz um servi\u00e7o
  interessante, que ser\u00e1 comentado a seguir, o Extra Fotos. O site foi criado
  justamente para o p\u00fablico poder revelar suas fotos digitais, com toda a comodidade
  pois o servi\u00e7o pode ser feito diretamente pela internet, sem precisar se deslocar
  \u00e0 loja pessoalmente.\\nVamos comentar um pouco sobre o servi\u00e7o prestado
  no site, e fazer uma an\u00e1llise para concluirmos se realmente vale a pena. A
  id\u00e9ia \u00e9 a seguinte: Voc\u00ea escolhe as fotos que deseja revelar, e ao
  acessar o site www.extrafotos.com.br, podemos fazer um pedido de revela\u00e7\u00e3o
  que \u00e9 registrado o site, e em seguida as fotos s\u00e3o enviadas via correio
  para o cliente, depois de alguns dias.\\nAlguns detalhes importantes devem ser comentados,
  como o fato do site apenas fazer upload atrav\u00e9s do Internet Explorer. Quem
  utiliza outros navegadores, como o Opera, Google Chrome ou qualquer outro, ter\u00e1
  de ser obrigado a mudar de navegador para que o site funcione corretamente, o que
  pode ser um inc\u00f4modo pois muitas pessoas simplesmente detestam utilizar o Internet
  Explorer (Firefox at\u00e9 que \u00e9 aceit\u00e1vel).\\nOutro ponto negativo a
  ser citado \u00e9 a qualidade das fotos reveladas. Para se fazer o upload no Extra
  Fotos, \u00e9 necess\u00e1rio instalar um plugin ActiveX (exclusivo do Internet
  Explorer) para que as fotos sejam carregadas no sistema de revela\u00e7\u00e3o do
  site. Esse plugin faz o seguinte: Comprime as fotos carregadas e as envia em uma
  qualidade inferior \u00e0 original da c\u00e2mera, fazendo com que a transfer\u00eancia
  das fotos seja mais leve e r\u00e1pida, mas ao mesmo tempo pecando na qualidade
  da mesma.\\nSegundo o site, n\u00e3o podem ser reveladas fotos maiores que 10x15cm.
  Caso isso aconte\u00e7a, a qualidade da foto vai ser reduzida. Quando elas forem
  carregadas no site, podemos escolher o tamanho das c\u00f3pias, o tipo de papel
  (fosco ou brilhante), e se queremos borda branca na foto. O processo \u00e9 f\u00e1cil
  de ser feito.\\nEm seguida, \u00e9 s\u00f3 aguardar. O correio faz o envio dos envelopes
  de maneira segura, pois s\u00e3o muito bem embalados e n\u00e3o correm risco de
  dobrar. J\u00e1 as fotos maiores (de 20x30cm) devem precisar de mais cuidado no
  envio. Parece que o sistema do site Extra Fotos est\u00e1 passando por modifica\u00e7\u00f5es,
  pois o site fica constantemente fora do ar e tamb\u00e9m n\u00e3o resultou em uma
  boa qualidade nas fotos reveladas, como era de se esperar, com a redu\u00e7\u00e3o
  de qualidade devido ao tamanho.\\nAlgumas pessoas tamb\u00e9m reclamaram de riscos
